import React from 'react';
import { Container } from 'react-bootstrap';
import './Style.css';

function ContentContainer() {

    return (
        <Container id="content_container">
          <div className="cube">
            <div className="cube_face --front">Front</div>
            <div className="cube_face --front">Front</div>
            <div className="cube_face --front">Front</div>
            <div className="cube_face --front">Front</div>
            <div className="cube_face --front">Front</div>
            <div className="cube_face --front">Front</div>
          </div>
        </Container>
      );
}

export default ContentContainer;
